import React from 'react';
import planeImage from './API Model Deployment/flight-foresight/src/images/kisspng-airplane-mode-computer-icons-plane-5acdf256b24965.6757273115234463587303.png';

const BackgroundTravelWebsite = () => {
    return (
        <div style={{ backgroundColor: '#00008B', textAlign: 'left', paddingLeft: '20px' }}>
             <h1 style={{ color: '#FFFFFF', fontSize: '70px' }}>JetSet</h1>
             <img src={planeImage} alt="JetSet" style={{ width: '300px', height: 'auto' }} />

        </div>
    );
};

export default BackgroundTravelWebsite;
